import React, { useContext } from 'react';

import { Context } from '../context/GlobalState';

const RoomTitle = props => {

  return (
    <Context.Consumer>
      {context => (
        <div>
          {context.rooms.map(item => item)}
        </div>
      )}
    </Context.Consumer>
  )
}

export default RoomTitle;
